import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {

  return (
      <BrowserRouter basename="/">
        <Switch>
          <Route exact path="/">
            <h1>Это наша стартовая страница</h1>
          </Route>
          <Route path="/new">
            <h1>Это наша страница с чем-то новеньким</h1>
          </Route>
        </Switch>
      </BrowserRouter>
  );
}

export default App;
